comment:
These vlogs serve so many positive purposes:

1. Beautiful memorabilia for Felix, Marzia, and Bjorn;
2. Audio-visual therapy for my mental health;
3. An honest way to make money for Felix.

I used to not look forward to these vlogs since I'm hesitant to change as a person and it was a bit difficult for me to accept the vlogs compared to Felix's other content types. But now these vlogs are the first I click to whenever I log onto Youtube!
